import React, {Component} from 'react';

class Header extends Component{
    render(){
        return (
            <div className="header">  
            <nav>
                <ul>
                    <ul><a href="#"></a>{this.props.row1}</ul>
                    <ul><a href="#"></a>{this.props.row2}</ul>
                    <ul>{this.props.row3}</ul>
                    <ul>{this.props.row4}</ul>
                    <ul>{this.props.row5}</ul>
                </ul>
            </nav>
             </div>
        )
    }
}
export default Header;
